import axios from 'axios';

const apiClient = axios.create(
    {
        baseURL: 'http://localhost:8080'
    }
)

export const retrieveHelloWorldBean = () => axios.get('/hello-world-bean');
export const retrieveHelloWorldPathVariable = (username) => axios.get(`/hello-world/path-variable/${username}`);
